INSERT INTO `jobs` (`id`, `name`, `descr`, `high_prio_skills`, `medium_prio_skills`, `low_prio_skills`, `domain`) VALUES
(2, 'Ingegnere del software', 'Cerchiamo una figura che abbia maturato almeno 2 anni di esperienza in questo ruolo.<br>\r\nOffriamo contratto a tempo indeterminato con RAL da 25.000-40.000€ in base all\'esperienza.', 'UML Diagrams,Capacità organizzative,Software testing', 'GitHub,Software organizer ', 'MS Project', 1),
(3, 'Ux Designer - junior', 'Cerchiamo una figura che possa progettare l\'esperienza di utilizzo per applicativi mobili.\r\nIn particolare su Sistemi Android per applicazioni ibride e native.\r\n<br>\r\n<br>\r\nRequisiti:<br>\r\nLaurea triennale in Informatica o corsi affini o corsi specializzanti in questo ambito.\r\n<br>\r\n<br>\r\nRequisiti opzionali:<br>\r\nEsperienza pregressa facoltativa, buona conoscenza della lingua inglese.\r\n\r\n', 'Photoshop', '', '', 1),
(8, 'Sviluppatore SAP', 'Ci serve uno sviluppatore SAP', 'Excel', '', '', 1),
(9, 'UI Designer - Senior ', 'Cerchiamo uno UI Designer con almeno 5 anni di esperienza.\nRAL: 40.000-50000€', 'Photoshop', 'Videomaker', 'Excel', 1),
(10, 'Sviluppatore Software', 'Cerchiamo una figura per lo sviluppo di applicativi ibridi e nativi per sistemi Android.\r\n<br>\r\nOffriamo contratto a tempo indeterminato con RAL da 25.000-40.000€ in base all\'esperienza.\r\n<br>\r\n<br>\r\nRequisiti:<br>\r\nLaurea triennale in Informatica o Ingegneria informatica.\r\n<br>\r\n<br>\r\nRequisiti opzionali:<br>\r\nEsperienza pregressa facoltativa, buona conoscenza della lingua inglese.', 'Java,C,C++,PHP', 'SQL', 'Excel,Facebook ADS', 1),
(11, 'Astronauta', 'Cerchiamo un astronauta per la NASA', 'Motivazione', '', '', 2),
(12, 'Sviluppatore Back-End PHP', 'Cerchiamo una figura sia senior che junior da inserire nel team di sviluppo per un progetto di grandi dimensioni.', 'PHP', 'Tecnologie web', 'C++', 1);
